import {React, useState, useEffect} from "react";
//styles
import {Container, Main, MainBlock, UserInfo} from './Form.styles'



const initialValue = {
    username: "Could not get information",
    email: "",
    totalCost: "",
    firstTrip: "",
    lastTrip: "",
    balance: ""
}



let data = [
    {
        id: "1",
        tag: "customer",
        firstName: "Johanna",
        sirName: "Persson",
        email: "johanna@example.se",
        trips: [
            {
                id: "1",
                date: "2021-11-08",
                price: "25",
                start: {
                    position: {
                        lat: "56.164527",
                        long: "15.584790"
                    },
                    time: "16:08"
                },
                stop: {
                    position: {
                        lat: "56.164527",
                        long: "15.584790"
                    },
                    time: "16:22"
                }
            },
            {
                id: "2",
                date: "2021-11-09",
                price: "55",
                start: {
                    position: {
                        lat: "56.164527",
                        long: "15.584790"
                    },
                    time: "12:04"
                },
                stop: {
                    position: {
                        lat: "56.164527",
                        long: "15.584790"
                    },
                    time: "12:44"
                }
            }
        ],
        balance: "500"
    }
]


const History  = ()  => {

    const [userHistory, setUserHistory] = useState([]);

    useEffect(() => {
        console.log(data[0])

        if (data[0]) {
            data = data[0];
        }
        setUserHistory(data.trips)
        console.log(userHistory)
    }, [])

    function calculateTravelTime(startTime, stopTime) {

        if(startTime && stopTime) {
            const splitStart = startTime.split(":");
            const splitStop = stopTime.split(":");
            console.log(splitStart, splitStop)
            let hours;
            let minutes;
            hours = splitStop[0] - splitStart[0];
            minutes = splitStop[1] - splitStart[1];
            console.log(hours)

        }



    }


	return (
        <Container>  
            <Main>
                <UserInfo>
                    <table>
                    <caption>Din Historik</caption>
                    <thead>
                        <tr>
                            <th scope="col">Id</th>
                            <th scope="col">Datum</th>
                            <th scope="col">Starttid</th>
                            <th scope="col">Sluttid</th>
                            <th scope="col">Visa på karta</th>
                            <th scope="col">Total tid</th>
                            <th scope="col">Kostnad</th>
                        </tr>
                    </thead>
                    <tbody>
                    {userHistory.map(elem => 
                        <tr>
                        <td data-label="Datum"> {elem.id} </td>
                        <td data-label="Datum"> {elem.date} </td>
                        <td data-label="Starttid"> {elem.start.time} </td>
                        <td data-label="Sluttid">{elem.stop.time} </td>
                        <td data-label="Visa på karta">{"KARTA"} </td>
                        <td data-label="Total tid">{calculateTravelTime(elem.start.time, elem.stop.time)} </td>
                        <td data-label="Kostnad">{elem.price}:- </td>
                        </tr>
                    )}

                    </tbody>
                    </table>
                </UserInfo>
            </Main>
        </Container>
    )
}

export default History
